:6;s:28:"Instead call a professional.";i:7;s:62:"Theyll have the knowledge and necessary tools to do so safely.";i:8;s:21:"Is the Gear Stripped.";i:9;s:141:"Another common reason garage doors wont open or close is when the gear in the opener breaks down which occurs over time due to wear and tear.";i:10;s:138:"In order to find out why your garage door wont close or open the first thing to do is a visual inspection of all the parts and components.";i:11;s:123:"Sometimes something as simple as a leaf blocking the safety sensor can cause the garage door to not open or close properly.";i:12;s:66:"The internal wiring on your motor may be the cause of the problem.";i:13;s:80:"If in doubt then leave the motor unplugged and have an electrician check it out.";i:14;s:94:"Bad wiring on a garage door opener can start an electrical fire that can get nasty real quick.";i:15;s:55:"My garage door wont close lights blinking on the motor.";i:16;s:184:"If your garage door doesnt close or open all the way the first thing that you should check for is to see if there is any type of obstacle that might be obstructing the doors operation.";i:17;s:147:"The first step is to take a look at the tracks and examine them for things such as dirt rocks or any other type of debris that might be in the way.";i:18;s:211:"If you decide to use a different remote control button than originally programmed into the opener you need to erase all the learned codes and reprogram each remote control used to operate the garage door opener.";i:19;s:21:"To erase all codes 1.";i:20;s:111:"Press and hold the SRT button on the overhead opener panel until the indicator light turns off about 6 seconds.";i:21;s:85:"Here is the set of reasons which explains why your garage door wont open all the way.";i:22;s:28:"Damaged Garage Door Springs.";i:23;s:89:"One of the reasons why a garage door doesnt open all the way could be the faulty springs.";i:24;s:128:"With the passage of time garage door springs get damaged or broken hence it results in the half-way opening of your garage door.";i:25;s:137:"Wont open or close all the way When a garage door doesnt open or close all the way first check the opener alignment and adjust if needed.";i:26;s:177:"A misaligned garage door opener may cause the door or trolley to bind up-causing the opener to stop or reverse because opening or closing force exceeded the openers force limit.";i:27;s:41:"Why wont my garage door open all the way.";i:28;s:145:"Sometimes when it gets stopped halfway shut or open it might be that the springs are broken see 3 or the limit setting needs an adjustment see 7.";i:29;s:66:"If all else fails you might try spraying the track with lubricant.";i:30;s:53:"Other Reasons Your Garage Door Wont Open All The Way.";i:31;s:29:"The photo-eye is blocked out.";i:32;s:49:"The power source may be interrupted or disrupted.";i:33;s:37:"There may be loose or snapped cables.";i:34;s:44:"The level of sensitivity may need adjusting.";i:35;s:36:"The setting of the limit may be off.";i:36;s:108:"One of the most common reasons that the garage door may not close is because the lock-out button is engaged.";i:37;s:86:"This button is to prevent the door from opening or closing using the hand-held remote.";i:38;s:82:"To determine if this is the issue press the garage door button on the garage wall.";i:39;s:43:"Test the Balance and Alignment of the Door.";i:40;s:92:"To test the balance and alignment of your door see How to test the balance of a garage door.";i:41;s:95:"If the door is in good working order but still will not open all the way increase the UP force.";i:42;s:78:"If the door opens at least 5 feet you may need to increase your travel limits.";i:43;s:60:"COMMON REASONS A GARAGE DOOR WONT CLOSE OR OPEN ALL THE WAY.";i:44;s:86:"Automatic garage doors differ in design but most share similar components and systems.";i:45;s:97:"Both residential and commercial garage doors can run into trouble opening or closing all the way.";i:46;s:109:"If an operational problem exists and the garage door opener will not close the opener can be forced to close.";i:47;s:82:"Press and hold the wall console button until the garage door is completely closed.";i:48;s:68:"Check for interference from adjacent photo eye sensors of any brand.";i:49;s:48:"Door starts down then STOPS before it is closed.";i:50;s:23:"OR DOOR will only open.";i:51;s:154:"If your garage door wont open all the way call your garage door repair specialist Uplift Garage to quickly repair service or install your new garage door.";i:52;s:125:"We provide same day services repairs and installations to help get you back in action and make sure your family is kept safe.";}}